`,s.jsx(t.h3,{children:"What Didn't"}),`
`,s.jsxs(t.ul,{children:[`
`,s.jsxs(t.li,{children:[s.jsx(t.strong,{children:"Replication code"}),": My first pass at multiplayer networking was fragile. I underestimated Unreal's replication complexity, which led to brittle solutions under a limited scope. This, however, pushed me to use GAS with built-in replication, which ultimately proved valuable."]}),`
`,s.jsxs(t.li,{children:[s.jsx(t.strong,{children:"AI scope"}),": I aimed for bots that could feel like teammates, but their combat behaviors remained simplistic. They didn't react well to status effects or disruptive abilities, which limited believability. Still, as my first venture into game AI, I gained significant strides in my understanding of it."]}),`
`,s.jsxs(t.li,{children:[s.jsx(t.strong,{children:"Architecture debt"}),": Starting in Blueprint (then further bolting AI onto character controllers) created maintainability issues that required significant refactoring. This was a good learning experience, but some systems should have been built with better solutions from the start."]}),`
`,s.jsxs(t.li,{children:[s.jsx(t.strong,{children:"Content scope"}),": Only a handful of spells were ever fully implemented, leaving much of the intended tactical diversity unexplored. My initial goal to explore this FPS design space, while a success, still has more that can be done."]}),`
`]}),`
`,s.jsx(t.h3,{children:"Lessons Learned"}),`
`,s.jsxs(t.ul,{children:[`
`,s.jsxs(t.li,{children:[s.jsx(t.strong,{children:"Prototype first, refactor early"}),": Rapid iteration is valuable, but delaying an architectural reset makes later changes harder. For anything networked or extensible, C++ and GAS should have been the starting point, not a rewrite."]}),`
`,s.jsxs(t.li,{children:[s.jsx(t.strong,{children:"Scope AI realistically"}),": Strong game rules can carry weak AI, but overscoping AI ambitions without early planning and robust tooling undermines credibility."]}),`
`,s.jsxs(t.li,{children:[s.jsx(t.strong,{children:"Tooling is essential"}),": Debug visualizers and authoring tools saved the AI effort; in future projects, I'd build these in parallel with core systems."]}),`
`,s.jsxs(t.li,{children:[s.jsx(t.strong,{children:"MVP mindset"}),": Shipping a playable slice with a small set of polished mechanics is more valuable than a half-finished wide feature set."]}),`
`]}),`
