`,s.jsxs(t.p,{children:[s.jsx(t.em,{children:"Ganymede"})," is a first-person spell-based capture-the-flag prototype, built in Unreal Engine 5 for networked multiplayer with AI-controlled bots. The design focus was on tactical utility and battlefield control over pure mechanical aiming."]}),`
`,s.jsx(t.p,{children:"The first version was made entirely in Blueprint for speed of iteration. The second iteration was rebuilt in C++ and the Gameplay Ability System (GAS) to support improved networking, modularity, and performance."}),`
`,s.jsx(t.h2,{children:"The Challenge"}),`
`,s.jsx(t.p,{children:'I wanted to test how FPS design changes when direct-damage weapons are de-emphasized in favor of abilities that manipulate space, timing, and information. Capture-the-flag provides a natural structure for that -- it forces teamwork, creates evolving objectives, and gives bots a reason to coordinate beyond just "shoot the enemy."'}),`
